import logo from "./logo.svg";
import "./App.css";
import DataTableScene from "./scene/DataTableScene";
import Container from "@material-ui/core/Container";
import {
  AppBar,
  Toolbar,
  Typography,
  Box,
  Divider,
  Chip,
} from "@material-ui/core";
import MetricRow from "./components/main-page-metrics/MetricRow";
function App() {
  return (
    <div className="App">
      <AppBar position="static">
        <Toolbar> </Toolbar>
      </AppBar>

      <Container maxWidth="xl">
        <Box padding="32px 16px">
          <Typography variant="h4" style={{ textAlign: "left" }}>
            <span style={{ fontWeight: "bold" }}>Welcome Back, </span> Miranda!
          </Typography>
          <Typography
            variant="body2"
            style={{ textAlign: "left" }}
            color="text.primary"
          >
            Premium user
          </Typography>
        </Box>{" "}
        <Divider />
        <Box padding="24px 16px">
          <MetricRow />
        </Box>
        <Divider />
        <DataTableScene />
      </Container>
    </div>
  );
}

export default App;
